import React from "react";
import "../css/zaNas.css";
import CardEdukacija from "../components/CardEdukacija";

const ZaNas = () => {
  return (
    <div className="zaNas">
      <h1>За Нас</h1>
      <div className="cardsDiv">
        <CardEdukacija />
        <CardEdukacija />
        <CardEdukacija />
      </div>
    </div>
  );
};

export default ZaNas;
